import React from 'react';
import { View, Text, StyleSheet, FlatList } from 'react-native';

const ListScreen = () => {
  const friends = [
    { name: 'You' },
    { name: 'Me' },
    { name: 'Dupree' },
    { name: 'Him' },
    { name: 'Her' },
    { name: 'Electric Bugaleur' }
  ];

  return (
    <FlatList
      keyExtractor={(friend) => friend.name}
      data={friends}
      renderItem={({ item }) => {
        return <Text>{ item.name }</Text>
      }}
    />
    // renderItem={(element) => {}} />
    // Element === { item: { name: 'You' }, index: 0 }
  );
};

